import React from 'react'
import { Link } from 'react-router-dom';


const Links = () => {

    const navStyle = {
        color: '#ffffff',
        textDecoration: 'none'
    };
    return (
        <>
         <Link style={navStyle} to="/"><li>Home </li></Link>
        <Link style={navStyle} to="#"><li>About</li></Link>
        </>
    )
}

export default Links
